import React from 'react'
import { useState } from 'react'
const Report = () => {
    const [report, setReport] = useState({ "conemail": "", "conname": "", "connumber": "", "conmess": "" });
    const onChanges = (e) => {
        setReport((user) => {
            return {
                ...user, [e.target.name]: e.target.value
            }
        })
    }
    const onSubmit__ = () => {
            e.preventDefault();
            try{
                if(report.conemail && report.conname && report.connumber && report.conmess ){
                    setReport({"conemail": "", "conname": "", "connumber": "", "conmess": ""})
                }
                else{
                    console.log("fill form");
                }
            }
            catch(err){
                console.error("error spoted in report page" , err);
            }
            
    }


    return (
        <>
            <div >
                <form action='' encType='multipart/html' >
                    <label>Email:</label>
                    <input type='email' name='conemail' value='report.con'></input>
                    <label>Name:</label>
                    <input type='text' name='conname'></input>
                    <label>Mobile Number:</label>
                    <input type='number' name='connumber'></input>
                    <label>Message:</label>
                    <textarea rows='5' cols='3' name='conmess'></textarea>
                </form>
            </div>
        </>
    )
}

export default Report
